import React, { useState, useEffect } from 'react';

const GetRest = () => {
    const [posts, setPosts] = useState([]);
    const [name, setname] = useState([]);
    useEffect(() => {
        console.log('hello');
        fetch('http://192.168.1.26:8050/api/records/')
            .then((response) => response.json())
            .then((data) => {
                let records = []
                const number = Object.keys(data).length;
                for (let i = number - 10; i < number; i++) {
                    records.push(data[i])
                }
                console.log(records);
                setPosts(records);
            })
            .catch((err) => {
                console.log(err.message);
            });
        setname(posts)
    }, []);

    return (
        <div className="hi">
            <p>{name}</p>
            {/* <p>{posts[1]}</p> */}
        </div>)
}

export default GetRest;
